import React from "react";
import { Tabs, Tab } from "react-bootstrap-tabs";
import {Container} from 'react-bootstrap'

function EditorTabContain() {
  return (
    <div >
      
       
        <Tabs
          style={{ cursor: "pointer",border: "4px solid #8395a7" ,backgroundColor:'#656D78'}}
          headerStyle={{ fontWeight: "normal",color:'white',border:'2px'}}
          activeHeaderStyle={{ color: "#6D214F" }}
          contentStyle={{ backgroundColor: "#a4b0be" }}
        >
          <Tab label="Add News data" >
              <Container  style={{minHeight:"80vh",marginTop:1}}>
              Add news data
              </Container>
              
          
            </Tab>
            <Tab label="Add falano 1" >
              <Container style={{minHeight:"80vh"}}>
             Add falano 1
              </Container>
              
          
            </Tab>
            <Tab label="Add falano 2" >
              <Container style={{minHeight:"80vh"}}>
             Add falano 2
              </Container>
              
          
            </Tab>
        </Tabs>
     
    </div>
  );
}

export default EditorTabContain;
